import React, { useState } from 'react';
import Child from './child';

function Parent() {
  const [count, setState] = useState(0);

  const increment = () => {
    setState(count + 1);
  };

  return (
    <div>
      {count}
      <button onClick={increment}>+</button>
      <Child func={increment} />
    </div>
  );
}

export default Parent;
